import React from 'react';

const Profile = () => {

  return (
    <div className="card profile-card">
      <div className="profile-container">
        <div className="profile-image">
          <img src="https://www.fcbarcelona.com/fcbarcelona/photo/2020/05/07/48082955-e347-4de8-9184-c7862baae076/PIQUE_007-min.JPG" alt="" />
        </div>
        <div className="profile-details">
          <h2>John Doe</h2>
          <p>Email: john.doe@example.com</p>
          <p>Bio: Lorem ipsum dolor sit amet consectetur adipisicing elit. Ea accusantium dicta quasi repellendus! Laboriosam voluptatum illum repudiandae qui veritatis.</p>
          <p>Age: 29</p>
          <p>Date of Birth: 1992-05-05</p>
        </div>
      </div>
    </div>
  );
};

export default Profile;
